var ptBR={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Permitir","Allow in your wallet":"Permitir na sua carteira","Allow {symbol} first":["Permitir ",["symbol"]," primeiro"],"Allowance pending":"Provisão pendente","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Ocorreu um erro ao tentar executar esta troca. Pode ser necessário aumentar sua tolerância ao deslizamento. Se isso não funcionar, pode haver uma incompatibilidade com o token que você está negociando. Nota: a taxa de transferência e tokens de rebase são incompatíveis com Uniswap V3.","Approval pending":"Aprovação pendente","Approve":"Aprovar","Approve Permit2":"Approve Permit2","Approve in your wallet":"Aprove em sua carteira","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Aprovar ",["symbol"]," primeiro"],"Auto":"Automático","Auto Router":"Roteador automático","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Fechar","Confirm in your wallet":"Confirme na sua carteira","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Conectar-se à carteira","Connecting…":"Conectando…","Continue":"Continue","Convert {0} to {1}":["Converter ",["0"]," em ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Desconectar carteira","Dismiss":"Dispensar","Enter an amount":"Digite um valor","Error fetching trade":"Erro ao buscar a negociação","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Buscando o melhor preço…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Alta derrapagem aumenta o risco de movimento de preços","I don't have a wallet":"não tenho carteira","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Saldo insuficiente ",["0"]],"Invalid recipient":"Destinatário inválido","Max":"Máx","Max slippage":"Deslizamento máximo","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Dependências ausentes","Network fee":"Taxa de rede","No results found.":"Nenhum resultado encontrado.","No tokens are available on this network. Please switch to another network.":"Nenhum token está disponível nesta rede. Por favor, mude para outra rede.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Insira uma % de derrapagem válida","Powered by the Uniswap protocol":"Alimentado pelo protocolo Uniswap","Price impact":"Impacto do preço","Price updated":"Preço atualizado","Reload":"Reload","Reload the page":"Recarregue a página","Request rejected":"Request rejected","Review swap":"Troca de revisão","Search by token name or address":"Pesquisar por nome ou endereço de token","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Ocorreu um erro","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Sucesso","Swap":"Conversão","Swap failed: {0}":["A troca falhou: ",["0"]],"Switch network":"Mudar de rede","Switch network in your wallet":"Mude de rede em sua carteira","Switching network":"Rede de comutação","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"A invariante x*y=k do Uniswap não foi observada na conversão. Isto geralmente significa que um dos tokens que você está convertendo tem um comportamento de transferência personalizado.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"O token lançado não pode ser transferido. Pode haver um problema com o token lançado.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"O token resultante não pode ser transferido. Pode haver um problema com o token resultante.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"O token de saída não pode ser transferido. Pode haver um problema com o token de saída. Nota: a taxa de transferência e tokens de rebase são incompatíveis com Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Esta transação não terá sucesso devido ao movimento do preço. Tente aumentar sua tolerância ao deslizamento. Nota: a taxa de transferência e tokens de rebase são incompatíveis com Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Esta operação não será realizada, devido às alterações nos preços ou à taxa de transferência. Tente aumentar sua tolerância a discrepâncias.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Data-limite da operação","Transaction rejected":"Transação rejeitada","Transaction submitted":"Transação enviada","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Tente aumentar sua tolerância ao deslizamento.<0/>NOTA: A taxa de transferência e os tokens de rebase são incompatíveis com o Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Erro inesperado. Não foi possível estimar o gás para a troca.","Unexpected issue with estimating the gas. Please try again.":"Problema inesperado com a estimativa do gás. Por favor, tente novamente.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Ver no Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Aviso","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Sua transação será revertida se estiver pendente por mais tempo que esse período.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Sua operação será revertida se o preço sofrer alteração desfavorável acima deste percentual.","minutes":"Minutos","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," taxa"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { ptBR as default };
